import React, {Component} from 'react';

const GetWebsiteData = (props) => {        
    console.log(props);

    var heading = props.match(/<h1>\[ ([\d]*?) \]<\/h1>/)[1];

    return (
        <div>{heading}</div>
    );

}
export default GetWebsiteData;
